export const getMove = (move: any) => {
  let moveFinal = {
    id: move.id,
    name: move.name,
    power: move.power,
    pp: move.pp,
    type: move.type.name,
    accuracy: move.accuracy,
    damageClass: move.damage_class.name,
    priority: move.priority
  }
  if (move.meta.max_hits && move.meta.min_hits) {
    moveFinal.hits = {
      min_hits: move.meta.min_hits,
      max_hits: move.meta.max_hits,
    }
  }
  return moveFinal
}

export const getStats = (stat: any) => {
  return {
    base_stat: stat.base_stat,
    name: stat.stat.name
  }
}

export const getTypes = (type: any) => {
  return type.length > 1 ? {
    typeOne: type[0].type.name,
    typeTwo: type[1].type.name
  } : {
    typeOne: type[0].type.name
  }
}
